<?phpnamespace Nemundo\WebLog\Install;use Nemundo\App\Application\Type\Install\AbstractUninstall;use Nemundo\App\Scheduler\Setup\SchedulerSetup;use Nemundo\App\Script\Setup\ScriptSetup;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\WebLog\Application\WebLogApplication;use Nemundo\WebLog\Data\WebLogModelCollection;use Nemundo\WebLog\Scheduler\WebLogAnalyzerScheduler;use Nemundo\WebLog\Script\WebLogCleanScript;class WebLogUninstall extends AbstractUninstall{    public function uninstall()    {        (new ModelCollectionSetup())->removeCollection(new WebLogModelCollection());        (new SchedulerSetup(new WebLogApplication()))            ->removeScheduler(new WebLogAnalyzerScheduler());        (new ScriptSetup())            ->removeScript(new WebLogCleanScript());    }}